import React from 'react';
import ToDoListItem from './ToDoListItem';

const ToDoList = ( {todoData} ) =>{
    return(
      <ul>
        <li><ToDoListItem 
            label = { todoData[0].label }
            important = { todoData[0].important }
            />
        </li>
        <li><ToDoListItem 
            label = { todoData[1].label }
            important = { todoData[1].important }
            />
        </li>
        <li><ToDoListItem 
            label = { todoData[2].label }
            important = { todoData[2].important }
            />
        </li>
      </ul>
    );
  };

  export default ToDoList;
